# 初始化 BERT tokenizer 和模型
tokenizer = BertTokenizer.from_pretrained('/home/yzu-zy/Model/bert-base-cased')
model = BertModel.from_pretrained('/home/yzu-zy/Model/bert-base-cased')

def embeding(word):
    # 使用 tokenizer 对两个字符串进行编码
    encoded_word = tokenizer(word, return_tensors='pt', padding=True, truncation=True)
    # 获取编码后的输入 ID
    input_ids_word = encoded_word['input_ids']
    # 使用模型获取词向量表示
    with torch.no_grad():
        outputs_word = model(input_ids_word)
    # 获取词向量表示的最后一层 hidden states
    word_embeddings_word = outputs_word.last_hidden_state
    # 计算平均向量
    average_vector_word = torch.mean(word_embeddings_word, dim=1)
    # 将 PyTorch 张量转换为 NumPy 数组
    average_vector_word = average_vector_word.detach().numpy()
    # print(average_vector_word)
    return average_vector_word


def load_data(filename):
    """
    载入数据
    :param filename: 文件名
    :return:
    """
    with open(filename, 'r',encoding='gb18030') as file:
        data = []
        label = []
        for line in file:
            columns = line.strip().split('\t')
            data_temp = [float(col) for col in columns[:-1]]  # 前 n-1 列作为数据
            data.append(data_temp)
            label_temp = columns[-1]  # 最后一列作为标签
            label.append(label_temp)

    # data = np.loadtxt(filename, delimiter='\t')
    # print(data)
    # print(label)
    return data,label


def distance(x1, x2):
    """
    获得两个样本点之间的距离
    :param x1: 样本点1
    :param x2: 样本点2
    :return:
    """
    dist = np.sqrt(np.power(x1 - x2, 2).sum())
    # print(dist)
    return dist


def get_dist_matrix(data):
    """
    获取距离矩阵
    :param data: 样本集合
    :return: 距离矩阵
    """
    n = len(data)  # 样本总数
    dist_matrix = np.zeros((n, n))  # 初始化邻接矩阵为n×n的全0矩阵
    for i in range(n):
        for j in range(i + 1, n):
            dist_matrix[i][j] = dist_matrix[j][i] = distance(data[i], data[j])
    return dist_matrix


def getW(data, k):
    """
    获的邻接矩阵 W
    :param data: 样本集合
    :param k : KNN参数
    :return: W
    """
    n = len(data)
    dist_matrix = get_dist_matrix(data)
    W = np.zeros((n, n))
    for idx, item in enumerate(dist_matrix):
        idx_array = np.argsort(item)  # 每一行距离列表进行排序,得到对应的索引列表
        W[idx][idx_array[1:k + 1]] = 1
    transpW = np.transpose(W)
    return (W + transpW) / 2


def getD(W):
    """
    获得度矩阵
    :param W: 邻接矩阵
    :return: D
    """
    D = np.diag(sum(W))
    return D


def getL(D, W):
    """
    获得拉普拉斯矩阵
    :param W: 邻接矩阵
    :param D: 度矩阵
    :return: L
    """
    return D - W


def getEigen(L, cluster_num):
    """
    获得拉普拉斯矩阵的特征矩阵
    :param L:
    :param cluter_num: 聚类数目
    :return:
    """
    eigval, eigvec = np.linalg.eig(L)
    ix = np.argsort(eigval)[0:cluster_num]
    return eigvec[:, ix]


from sklearn.metrics.pairwise import euclidean_distances

def cluster(data, cluster_num, k, max_words_per_cluster):
    data = np.array(data)
    W = getW(data, k)
    D = getD(W)
    L = getL(D, W)
    eigvec = getEigen(L, cluster_num)
    clf = KMeans(n_clusters=cluster_num)
    s = clf.fit(eigvec)  # 聚类
    labels = s.labels_

    # 创建簇列表，用于存储聚类后的结果
    cluster_lists = [[] for _ in range(cluster_num)]

    # 将数据点分配到对应的簇中
    for idx, label in enumerate(labels):
        cluster_lists[label].append(data[idx])
    lis = ['uninterested','interested']
    # 遍历每个簇，修剪多余的单词，并按距离远近排序
    for i in range(cluster_num):
        cluster_size = len(cluster_lists[i])
        if cluster_size > max_words_per_cluster:
            cluster_data = np.array(cluster_lists[i])
            # 自定义中心点
            custom_center = embeding(lis[i])[0]
            # 计算每个样本点与自定义中心点之间的欧式距离
            distances = euclidean_distances(cluster_data, [custom_center]).flatten()
            # 获取距离从小到大的索引
            sorted_indices = np.argsort(distances)
            # 保留前 max_words_per_cluster 个单词，按照距离远近排序
            cluster_lists[i] = [cluster_data[j] for j in sorted_indices[:max_words_per_cluster]]

        # 聚类完成后，绘制散点图
        plt.figure(figsize=(8, 6))
        for i in range(cluster_num):
            cluster_data = np.array(cluster_lists[i])
            plt.scatter(cluster_data[:, 0], cluster_data[:, 1], label=f'Cluster {i + 1}')
        plt.xlabel('Feature 1')
        plt.ylabel('Feature 2')
        plt.title('Cluster Visualization')
        plt.legend()
        plt.show()

    return cluster_lists




